description:
If you're someone who has been going to the gym but seeing little in the way of results, or if you're a personal trainer or coach who wants to learn more to apply with your clients, then you are in the right place.

We cover everything from nutrition to biomechanics so that you have all of the information you and your clients need to level up your training, nutrition and achieve your dream physique!

Hosted by Physique Factory coaches Conor Moran and James Tildsley.

Check us out on Instagram for more free content!

@physique_factory_coaching 
@cm_physiquefactory
@jt_physiquefactory

Alex and I are 2 very invested online physique coaches and bodybuilding competitors who want to bring this podcast to you in an educational yet informal manner. 

We will be touching on many important topics of training, nutrition, PEDs, mental health and many other topics through the lens of personal experience, evidence-based practice and with a host of established guests in their respective fields.

If you have any questions or feedback with regard points mentioned or topics in particular you'd like us to cover, please reach out to either of us on Instagram, 
@daragh_allen
@therealmrfreshwater

Thanks for listening!
